### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. State Space and Search Algorithms
- **State Space**: The set of all possible states that a system can be in. In the context of the rabbits crossing puzzle, the state space includes all possible configurations of the rabbits and the empty spot.
- **State Space Graph**: A graph where nodes represent states and edges represent transitions between states.
- **Search Algorithms**:
  - **Depth First Search (DFS)**: Explores as far as possible along each branch before backtracking.
  - **Breadth First Search (BFS)**: Explores all neighbors at the present depth before moving on to nodes at the next depth level.
  - **Best First Search**: Uses a priority queue to explore the most promising node first, often based on a heuristic.
  - **Hill Climbing**: A local search algorithm that continually moves to the best neighboring state.

#### 2. Genetic Algorithms
- **Path Representation**: A way to represent a tour or path through a set of cities or nodes.
- **Adjacency Representation**: A way to represent a tour or path based on the adjacency of nodes.
- **Ordinal Representation**: A numerical representation of a path.
- **Partially Mapped Crossover (PMX)**: A genetic operator used to combine two parent tours to produce offspring tours.

#### 3. Traveling Salesman Problem (TSP)
- **Nearest Neighbor Heuristic**: Constructs a tour by starting at a city and repeatedly visiting the nearest unvisited city.
- **Greedy Heuristic**: Constructs a tour by always choosing the next city with the smallest edge cost.
- **Savings Algorithm**: A heuristic for constructing a tour by calculating the savings of combining pairs of cities.

#### 4. Manhattan Distance
- **Manhattan Distance**: A metric used to measure the distance between two points in a grid-based path. It is calculated as the sum of the absolute differences of their Cartesian coordinates.
  \[
  \text{Manhattan Distance} = |x_1 - x_2| + |y_1 - y_2|
  \]

